import React from 'react';
import Logo from '../assets/images/logo.png';
import '../Styles/SideNav.css';
import {HomeIcon,SearchIcon,LibraryIcon} from './assets/icons/Icons';

function SideNav() {
    return (
        <div className="side-nav">
            <div className="header-logo">
                <img src={Logo} />
            </div>
            <ul>
                <li><a>Home</a></li>
                <li><a>Search</a></li>
                <li><a>Your Library</a></li>
            </ul>
            <div>
            <ul>
            <li><a>Create Playlist</a></li>
            <li><a>Liked Songs</a></li>
            </ul>
            </div>
        </div>
    )
}

export default SideNav
